import "./Admin.css"
import {  useHistory } from "react-router-dom";


function Admin(){

    const history = useHistory();


    function handleProduct(){
        history.push("/addProduct")
    }
   


    return(
        <div className="main">
            
           <p className="m-5 text-dark h3">Hey,Cheif how's the day</p>
           <div className=" container text-center mb-5 ">
                <img  className="img" src="https://cdn.business2community.com/wp-content/uploads/2014/09/product-600x290.jpg" alt=".."></img>
                <button onClick={handleProduct} className="admin-button">Create Product</button>
            </div>
            </div>
       
    )
}

export default Admin;
